this.getTable = function(title_name, arr_column_names, obj_contents){

    var width_of_column = Math.round(100 / arr_column_names.length);

    var number_of_balance = 100 - (width_of_column * arr_column_names.length);

    var str_table = "<table border = 1 style='width:100%;text-align:center'>";

    var str_tr = "", str_th = "", str_td = "";

    //Số lượng columns có trong 1 bảng
    var number_of_columns = arr_column_names.length + 1;
    var width_of_column_current = 0;

    //Title của bảng
    if(title_name.length > 0)
    {
        str_tr = "<tr>";

        str_th = "<th colspan = '" + number_of_columns.toString() + "' style='text-align:center;padding-top:5px;padding-bottom:5px'>" + title_name + "</th>";

        str_tr += str_th + "</tr>"
    }

    str_table += str_tr;

    //ColumnNames of bảng
    str_tr = "<tr>";
    str_th = "";

    for(var i = 0; i < arr_column_names.length; i++)
    {
        if(i == arr_column_names.length - 1)
        {
            width_of_column_current = width_of_column + number_of_balance;
        }
        else
        {
            width_of_column_current = width_of_column;
        }

        str_th += "<th style='width:" + width_of_column_current.toString() + "%;text-align:center;padding-top:5px;padding-bottom:5px'>" + arr_column_names[i].toString() + "</th>";
    }

    str_tr += str_th + "</tr>";

    str_table += str_tr;

    //Nội dung cua bảng
    //var element = {}; element[key] = value
    for(var key in obj_contents){

        var content = obj_contents[key];

        str_tr = "<tr>";
        str_td = "";

        width_of_column_current = 0;

        for(var prop in content){

            if(prop == arr_column_names.length - 1)
            {
                width_of_column_current = width_of_column + number_of_balance;
            }
            else
            {
                width_of_column_current = width_of_column;
            }

            str_td += "<td style='width:" + width_of_column_current.toString() + "%;text-align:left;padding-top:5px;padding-bottom:5px;border:1px solid white'>" + content[prop].toString() + "</td>";    
        }

        str_tr += str_td + "</tr>";

        str_table += str_tr;
    }

    str_table += "</table>";

    return str_table;
};

this.getListDistrictsByProvince = function(arr_listdistricts, province) {

    var arrListDistrictsByProvince = [];

    var provinceName = province.toString().replace("_","").toString();

    for(var i = 0; i < arr_listdistricts.length; i++)
    {
        var arrDistrictStruct = arr_listdistricts[i].toString().split("#");

        if(parseInt(provinceName) === parseInt(arrDistrictStruct[0]))
        {
            arrListDistrictsByProvince.push(arrDistrictStruct[2].toString());
        }
    }

    return arrListDistrictsByProvince;
};

this.getListDistricts = function(arr_listprovinces) {

    //Declare an empty array to store districts of the provinces selected at _ResProvinces
    var arrListDistricts = [];

    var stringWhereProvinces = "", stringTempt = "";

    for(var i = 0; i < arr_listprovinces.length; i++)
    {
        stringTempt = "ProvinceID = " + arr_listprovinces[i].replace("_","").toString();

        if(stringWhereProvinces.length === 0)
        {
            stringWhereProvinces = stringTempt;
        }
        else
        {
            stringWhereProvinces = stringWhereProvinces + " Or " + stringTempt;
        }
    }

    var sqlSelect = "Select * from '04EB4AD6-1CFA-4DFC-BAFC-D4ED373FA494' T1 Where " + stringWhereProvinces + " Order By DistrictID ASC";

    //Execute the SQL query against the database
    var exeNonQuery = OSM.Survey.dbExec(sqlSelect);

    //Go through the obtained JSON structure and populate the models in the array
    var dsObject = JSON.parse(exeNonQuery);

    for(var i = 0, size = dsObject.length; i < size; i++)
    {
        arrListDistricts.push(dsObject[i][0] + "#" + dsObject[i][1] + "#" + dsObject[i][2]);
    }

    return arrListDistricts;
};

OSM.Survey.precisionRound = function(number, precision){

    var factor = Math.pow(10, precision);

    return Math.round(number * factor) / factor;
};

