OSM.Survey.valCheckServiceBanking = function(event){

    var arr_1 = new Array();
    arr_1 = OSM.Survey.convertArray(OSM.Survey._ServiceBanking_1.getAnswers());

    var arr_2 = new Array();
    arr_2 = OSM.Survey.convertArray(event.sourceElement.getAnswers());

    var arrGroups = new Array();

    for(var i = 0; i < arr_2.length; i++)
    {
        var group_id = "_" + event.sourceElement[arr_2[i].toString()].get('measure');

        if(arr_1.indexOf(group_id) != -1 && arrGroups.indexOf(group_id) == -1)
        {
            arrGroups.push(group_id);
        }
    }

    if(arr_1.length == arrGroups.length)
    {
        return{
            status:true
        };
    }
    else
    {
        return{
            status: false,
            message: "Kiểm tra mỗi gói dịch vụ cần chọn ít nhất 1 code!.."
        };
    }
};

OSM.Survey.valcheckPRE = function(event){

    var sp1 = OSM.Survey._SP1_Label.getComment();
    var sp2 = OSM.Survey._SP2_Label.getComment();

    var sp1_score = parseInt(OSM.Survey._P1_R1.get('answerSet')[OSM.Survey._P1_R1.getAnswers()].get('measure'));
    var sp2_score = parseInt(OSM.Survey._P1.get('answerSet')[OSM.Survey._P1.getAnswers()].get('measure'));

    if((event.sourceElement.isAnswerSelected(['_1']) && sp1_score - sp2_score < -2) || (event.sourceElement.isAnswerSelected(['_2']) && sp2_score - sp1_score < -2))
    {
    return{
        status: false,
        message: "Kiểm tra lại thứ hạng sản phẩm (SP " + sp1 + ": P1 = " + sp1_score + ", SP " + sp2 + ": P1 = " + sp2_score + ")"
        };
    }

    return{
        status:true
    };
};
