var obj_Rotation = {

    '_1' : ['_1','_2'],
    '_2' : ['_2','_1'],
};

OSM.Survey._SEC_CELL.addEventListener("onEntrance", function(event) {

    OSM.Survey.initializeQuestion(OSM.Survey._Cell, OSM.Survey._CELL_RECRUIT.getAnswers());

    OSM.Survey._Rotation['_1']._Rotation_Codes['_1'].enable();
    OSM.Survey._Rotation['_1']._Rotation_Codes['_2'].enable();
    OSM.Survey._Rotation['_2']._Rotation_Codes['_1'].enable();
    OSM.Survey._Rotation['_2']._Rotation_Codes['_2'].enable();

    OSM.Survey._Rotation['_1']._Rotation_Codes.setAnswers('_1');
    OSM.Survey._Rotation['_2']._Rotation_Codes.setAnswers('_2');

    OSM.Survey._Rotation['_1']._Rotation_Codes['_2'].disable();
    OSM.Survey._Rotation['_2']._Rotation_Codes['_1'].disable();

    OSM.Survey._SP1_Label.setComment(OSM.Survey._ProductSelected[obj_Rotation[OSM.Survey._Cell.getAnswers()][0]].get('text').getText());
    OSM.Survey._SP2_Label.setComment(OSM.Survey._ProductSelected[obj_Rotation[OSM.Survey._Cell.getAnswers()][1]].get('text').getText());

    if(OSM.Survey._Recall.isAnswerSelected(['_1','_2']))
    {
        OSM.Survey.initializeQuestion(OSM.Survey._ProductSelected, obj_Rotation[OSM.Survey._Cell.getAnswers()][0]);
    }
    else
    {
        OSM.Survey.initializeQuestion(OSM.Survey._ProductSelected, obj_Rotation[OSM.Survey._Cell.getAnswers()][1]);
    }
});

