OSM.Survey.addEventListenersToElements(["_p_liking_colour","_p_liking_smell","_p_liking_overallflavor","_p_liking_flavor_lemon","_p_liking_sweet","_p_liking_sour","_p_liking_mouthfeel","_p_liking_fizziness","_p_liking_aftertaste"], "onNext", function(event){

    var q1 = OSM.Survey._P1;
    var q2 = event.sourceElement;
    var q_confirm = event.sourceElement.get('objectName') + "_Confirm";

    OSM.Survey.hideQuestions(OSM.Survey.convertArray(q_confirm));

    if((q1.isAnswerSelected(['_8','_9']) && q2.isAnswerSelected(['_1','_2'])) || (q1.isAnswerSelected(['_1','_2']) && q2.isAnswerSelected(['_8','_9'])))
    {
        OSM.Survey.showQuestions(OSM.Survey.convertArray(q_confirm));
    }
});

