   var q2 = event.sourceElement;
   var q_confirm = event.sourceElement.get('objectName') + "_Confirm";

   switch(event.sourceElement.get('objectName'))
   {
        case "_p_jar_colour":
            q1 = OSM.Survey._p_liking_colour;
            break;
        case "_p_jar_smell":
            q1 = OSM.Survey._p_liking_smell;
            break;
        case "_p_jar_overallflavor":
            q1 = OSM.Survey._p_liking_overallflavor;
            break;
        case "_p_jar_flavor_lemon":
            q1 = OSM.Survey._p_liking_flavor_lemon;
            break;
        case "_p_jar_sweet":
            q1 = OSM.Survey._p_liking_sweet;
            break;
        case "_p_jar_sour":
            q1 = OSM.Survey._p_liking_sour;
            break;

        case "_p_jar_fizziness":
            q1 = OSM.Survey._p_liking_fizziness;
            break;
        case "_p_jar_aftertaste":
            q1 = OSM.Survey._p_liking_aftertaste;
            break;
   }

   OSM.Survey.hideQuestions(OSM.Survey.convertArray(q_confirm));

    if((q1.isAnswerSelected(['_8','_9']) && q2.isAnswerSelected(['_1','_5'])) || (q1.isAnswerSelected(['_1','_2']) && q2.isAnswerSelected(['_3'])))
    {
        OSM.Survey.showQuestions(OSM.Survey.convertArray(q_confirm));
    }
});

