OSM.Survey._PRE_LOOP.addEventListener("onEntrance", function(event){

    var pre_loop = OSM.Survey._PRE_LOOP;

    if(!OSM.Survey._PRE1.isAnswerSelected(['_98']))
    {
        q_fre = OSM.Survey._PRE1;
    }
    else
    {
        q_fre = OSM.Survey._PRE2;
    }

    pre_loop.getIteration('_1')._Codes.setAnswers(obj_Rotation[OSM.Survey._Cell.getAnswers()][parseInt(q_fre.getAnswers().replace("_",""))-1]);
    pre_loop.getIteration('_2')._Codes.setAnswers(OSM.Survey.differenceCategories(obj_Rotation[OSM.Survey._Cell.getAnswers()], pre_loop.getIteration('_1')._Codes.getAnswers()));
    //disable ans
    pre_loop.getIteration('_1')._Codes.disableAnswers(OSM.Survey.differenceCategories(OSM.Survey.definedCategories(pre_loop.getIteration('_1')._Codes), pre_loop.getIteration('_1')._Codes.getAnswers()));
    pre_loop.getIteration('_2')._Codes.disableAnswers(OSM.Survey.differenceCategories(OSM.Survey.definedCategories(pre_loop.getIteration('_2')._Codes), pre_loop.getIteration('_2')._Codes.getAnswers()));
});

